jobjectArray SettingsList(JNIEnv *env, jobject activityObject) {
    jobjectArray ret;

    const char *features[] = {
            "Category_settings",
            "-1_Toggle_saveData_True", //-1 is checked on Preferences.java
            "-3_Toggle_autoSize",
            "Category_Menu",
            "-6_Button_close",
    };

    //int Total_Feature = (sizeof features /
    //                     sizeof features[0]); //Now you dont have to manually update the number everytime;
	int Total_Feature = 5;

    ret = (jobjectArray)
            env->NewObjectArray(Total_Feature, env->FindClass("java/lang/String"),
                                env->NewStringUTF(""));
    int i;
    for (i = 0; i < Total_Feature; i++)
        env->SetObjectArrayElement(ret, i, env->NewStringUTF(features[i]));

    return (ret);
}
